import React from "react";

const trevel = "";
const Components = [
  {
    categories: [
      { name: "all" },
      { name: "mountains" },
      { name: "the sea" },
      { name: "architecture" },
      { name: "the city" },
    ],
    collections: [
      {
        category: 2,
        name: "mountain hiking",
        photo: [],
      },
    ],
  },
];

function Galere() {
  return (
    <div className="galere">
      <h1>My photo collection </h1>
      <div className="top">
        <ul className="tahs">
          <li>all</li>
          <li>mountains </li>
          <li>the sea</li>
          <li>architecture</li>
          <li>the city</li>
        </ul>
      </div>
    </div>
  );
}

export default Galere;
